Matching Users Together For a 1v1 Game Using a Method That Scales Node.js/Express/MongoDB<p>Recently I have been working on a game that automatically matches two users together to play against one another if they are both trying to join a game with the same parameters. This matching is not concurrent, meaning that both users do not have to be online at the same time to match them. I am using MongoDB to store the games, which have a schema that looks like this.</p>
<pre><code>    {
        competitorID1: {type: String, unique: false, required: true},
        competitorID2: {type: String, unique: false, required: false, default: null},
        needsFill: {type: Boolean, unique: false, required: true, default: true},
        parameter: {type: Number, unique: false, required: true}
    }
</code></pre>
<p>Currently, this is what my controller function to create/join a game looks like.</p>
<pre><code>exports.join = (req, res) =&gt; {
            Game.findOneAndUpdate({
                needsFill: true,
                parameter: req.body.parameter,
                competitorID1: {$ne: req.user._id}
            }, {
                // Add the second competitor
                needsFill: false,
                competitorID2: req.user._id,
        }).then(contest =&gt; {
             if(contest) {
                 // Game was found and updated to include two competitors
             }
             else {
                 // Game with parameter was not found. Create a new game with needsFill set to true and only the competitorID1 populated
             }
        });
}
</code></pre>
<p>My question is: will this scale to a large number of users concurrently using the system and trying to join a game? My understanding is that the</p>
<blockquote>
<p>findOneAndUpdate</p>
</blockquote>
<p>function offered by mongoose is atomic, and therefore prevents concurrent modification by multiple requests. Forgive me if my assumptions are not good, I'm still trying to find my footing using MongoDB. Even if this does work correctly, please let me know if there is a better way to accomplish my goal. Thank you so much in advance for any help!</p>

