Sum Quantity in Mongo Subdocument Based on Filter<p>I have a &quot;shipment&quot; document in MongoDB that has the following basic structure:</p>
<pre><code>shipment {
   &quot;id&quot;: &quot;asdfasdfasdf&quot;,
   &quot;shipDate&quot;: &quot;2021-04-02&quot;,
   &quot;packages&quot;: [
        {
            &quot;id&quot;: &quot;adfasdfasdfasdf&quot;,
            &quot;contents&quot;: [
                {
                    &quot;product&quot;: {
                        &quot;id&quot;: &quot;asdfasdfasdfasd&quot;
                    },
                    &quot;quantity&quot;: 10
                }
            ]
        }
    ]
}
</code></pre>
<p><em>Please note that &quot;product&quot; is stored as a DBRef.</em></p>
<p>I want to find the total quantity of a specific product (based on the product ID) that has been shipped since a given date. I believe this is the appropriate logic that should be followed:</p>
<ol>
<li>Match shipments with &quot;shipDate&quot; greater than the given date.</li>
<li>Find entries where &quot;contents&quot; contains a product with an &quot;id&quot; matching the given product ID</li>
<li>Sum the &quot;quantity&quot; value for each matching entry</li>
<li>Return the sum</li>
</ol>
<p>So far, this is what I've come up with for the Mongo query so far:</p>
<pre><code>db.shipment.aggregate([
    {$match: {&quot;shipDate&quot;: {$gt: ISODate(&quot;2019-01-01&quot;)}}},
    {$unwind: &quot;$packages&quot;},
    {$unwind: &quot;$packages.contents&quot;},
    {$unwind: &quot;$packages.contents.product&quot;},
    {
        $project: {
            matchedProduct: {
                $filter: {
                    input: &quot;$packages.contents.products&quot;,
                    as: &quot;products&quot;,
                    cond: { 
                        &quot;$eq&quot;: [&quot;$products.id&quot;, ObjectId(&quot;5fb55eae3fb1bf783a4fa97f&quot;)]
