Embed Field: MongoDB Docker authentication problem "Error: Authentication failed"<p>I am trying to set up a MongoDB Docker container to use as a local database for testing, but I am facing issues.</p>
<p>For running the container, I used following command:</p>
<p><code>docker run -d --name mongodb -p 27017:27017 -e MONGO_INITDB_ROOT_USERNAME=&quot;root&quot; -e MONGO_INITDB_ROOT_PASSWORD=&quot;password&quot; -v C:\projects\docker\volumes\mongotmp:/data/db mongo:4.4.4</code></p>
<p>I used <code>-e</code> to pass the root username and password environment variables, but I am not able to connect to the database, I tried using this connection string:</p>
<p><code>mongodb://root:password@localhost:27017/?authSource=admin</code></p>
<p>When I execute a shell inside the container, and try to get the users with <code>db.getUsers()</code> I get an authentication error.</p>

<pre class="lang-js prettyprint-override"><code>uncaught exception: Error: command usersInfo requires authentication :
_getErrorWithCode@src/mongo/shell/utils.js:25:13
DB.prototype.getUsers@src/mongo/shell/db.js:1659:15
</code></pre>

<p>Then, I tried authenticating with <code>db.auth(root, password)</code>, but no success.</p>

<pre class="lang-js prettyprint-override"><code>uncaught exception: ReferenceError: root is not defined
</code></pre>

<p>As suggested in the comments, I had to put quotes around <code>(&quot;root&quot;, &quot;password&quot;)</code> for authorizing, but still no good.</p>

<pre class="lang-js prettyprint-override"><code>Error: Authentication failed.
</code></pre>

<p>Someone online encountered this issue and the problem was that the person created and populated the volume before running the container with the environment variables, that way MongoDB wasn't able to find the root user. This shouldn't be the issue in my case because I removed the volume before spinning up the container.</p>
